import { FormControl, InputGroup } from "react-bootstrap";
import translate from "../i18n/translate";
import React from "react";
import Button from "react-bootstrap/Button";
import { CreateTeam } from "./APIs/OrdersAPIs";

export default function AdminBoard(){
    return (
        <div style={{display: "block", width: "85%", margin: "0 auto"}}>
            <InputGroup className="mb-3">
                <InputGroup.Prepend>
                    <InputGroup.Text>{translate("ADMIN.ENTER_TEAM_NAME")}</InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl
                    value=""
                    onChange={()=>{}}
                />
            </InputGroup>
            <Button
                variant="primary"
                onClick={()=>{
                    CreateTeam()
                    //createNewTeam                     
                    //transporterId
                    //teamName
                    //token
                }}
                style={{
                    float: "right",
                    border: "none",
                }}
            >
                {translate("ADMIN.CREATE_TEAM")}
            </Button>
        </div>
    )
}
